import time

class Solution(object):

    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        res = 0
        start = 0
        allStr = {}

        for index, ch in enumerate(s):
            if (ch in allStr and allStr[ch] >= start):
                start = allStr[ch] + 1
            allStr[ch] = index
            res = max(res, index - start + 1)

        return res


